import React, { useState, useEffect } from "react";
import {
  Row,
  Col,
  Form,
  FormSelect,
  Button,
  Slider,
  FormRadio,
  FormInput
} from "shards-react";
import { useTranslation } from "react-i18next";


function DripForm(props) {
  const { t, i18n } = useTranslation();


  return (
    <>
      <Col md="12" className="form-group">
        <p style={{ marginBottom: "0px" }}>{t('Irrigation_system_calculations')}</p>
      </Col>
      <Col lg="4" md="12" sm="12" className="form-group">
        <p style={{ margin: "0px" }}>{t('FlowRate')}</p>
        <FormInput
          value={props.flowrate}
          placeholder={t('FlowRate')}
          required
          onChange={props.handleFlowRate}
        />
      </Col>
      <Col lg="4" md="12" sm="12" className="form-group">
        <p style={{ margin: "0px" }}>{t('Drippers')}</p>
        <FormInput
          value={props.drippers}
          placeholder={t('Drippers')}
          required
          onChange={props.handleDrippers}
        />
      </Col>
      <Col lg="4" md="12" sm="12" className="form-group">
        <p style={{ margin: "0px" }}>{t('irrigated_already')}</p>
        <FormInput
          value={props.irrigated_already}
          placeholder={t('irrigated_already')}
          required
          onChange={props.handleIrrigAlrd}
        />
      </Col>
    </>
  );
}

export default DripForm;
